import logo from './logo.svg';
import './App.css';
import CharactersList from './pages/CharactersList';
import { Route, Routes } from 'react-router';

function App() {
  return (
    <div>
      <Routes>
       <Route path="/">
        <CharactersList/>
       </Route>
      </Routes>
    </div>
  );
}

export default App;
